import React from 'react'
import Menu from "./menuApi"

export const Menucard = ({ menuData }) => {
    // console.log(menuData);
  return (
    <>
            {menuData.map((curElem) => {
                return(
                    <>
                    <div className='card-container'>
                    <div className='card'>
                        <div className='card-body'>
                            <span className='card-number card-circle subtle'>1</span>
                            <span className='class-author subtle' >Breakfast</span>
                            <h2 className='card-title'> Maggie</h2>
                            <span className='card-description subtle'>
                                I love maggie very much an the good recipe I know to make maggie in just two minutes and its taste is beeter than Pantajali baba Ramdev's organic nuddles
                            </span>
                            <div className='card-read'>Read</div>
                            {/* <img src={Image} alt="images" className='card-media' /> */}
                            <span className='card-tag subtle'> Order Now</span>
                        </div>
                    </div>
                </div>
                </>
                )
            })}

           

            
        </>
  )
}

export default Menucard;
